import logo from './logo.svg';
import './App.css';

function App() {
	return (
		<div className="App">
			<header className="App-header">
				<label for="myfile">Select a file:</label>
				<input className="App-link" type="file" id="myfile" name="myfile"></input>
			</header>
      <button onClick={this.onFileUpload}>
                  Upload!
                </button>
		</div>
	);
}

export default App;
